import React from "react";
import Healthcheck from "../Images/Healthcheck.jpg"

function Freehealthcheck() {
    return (

        <div>

            <div>
                <img src = {Healthcheck} />
            </div>

            <div>

                <h1>Free Health Check Dogs</h1>
                <p></p>
            </div>

            <div></div>

        </div>
    )
}

export default Freehealthcheck;
